import React, { Component } from 'react';
import {BootstrapTable, TableHeaderColumn} from 'react-bootstrap-table';
import '../../node_modules/react-bootstrap-table/css/react-bootstrap-table.css';
import './Table.css';
import { Route, Link } from 'react-router-dom';

class table extends Component {

  CellFormatter(cell, row) {
    return (<div><a href={cell+"/addReviews"}>{cell}</a></div>);
  }
  
    render() {

    console.log("props : " , this.props)
    return (
        <div>

          
          <BootstrapTable data={this.props.data}>
          <TableHeaderColumn isKey dataField='Id'>
            Id
            </TableHeaderColumn>
            <TableHeaderColumn dataField='teamA'>
            teamA
            </TableHeaderColumn>
            <TableHeaderColumn dataField='teamB'>
            teamB
            </TableHeaderColumn>
            <TableHeaderColumn dataField='ScoreA'>
            ScoreA
            </TableHeaderColumn>
            <TableHeaderColumn dataField='ScoreB'>
            ScoreB
            </TableHeaderColumn>
            <TableHeaderColumn dataField='Time'>
            Time
            </TableHeaderColumn>
            <TableHeaderColumn dataField='Category'>
            Category
            </TableHeaderColumn>
            <TableHeaderColumn dataField=''  dataFormat='href="/addReviews"'>
            Add Reviews
            {/* <Link to="addReviews">Add Reviews</Link> */}
            </TableHeaderColumn>
          </BootstrapTable>
        </div>
      );
}
}

export default table
